	[script]
	id="dialog_1"
		[modification]
		on_process="[end_script(), speech_dialog(self, set(level.zoom, 2),
									set(level.player.facing, 1),
									set(level.focus, [self, level.player]),
									
									animation('mutter_begin'),
									[~So!  I've unlocked this gate, here.~],
									facing(1),
									animation('emote_caneshake'),
									[~Through there,\nis the way to where Milgram lives.~],
									animation('emote_confused'),
									[~It's all a bit convoluted,\nand I would explain it,\nbut as a matter of fact, I don't need to.~],
									set(level.player.animation, 'emote_confused'),
					level.player,	[~Huh?~],
									facing(-1),
									animation('mutter_begin'),
					self,			[~Yes, that blue fellow you ran into..\nBerd was his name.~],
									animation('mutter_begin'),
									[~He'll follow you from above,\nand will keep you informed.~],
									animation('emote_emphatic'),
									[~He's a good boy, that one.~],
									set(level.player.animation, 'emote_nod'),
					level.player,	[~Okay, that'll help!~],
									animation('emote_confused'),
					self,			[~Now, this'll take you over a bridge,\nthen through an underground passage.~],
									animation('mutter_begin'),
									[~Watch your head in there.~],
									animation('mutter_begin'),
									[~Past that, and you come to the forest.~],
									animation('emote_confused'),
									[~I haven't been there in a long time,\nso I'm not sure what's become of it.~],
									set(level.player.animation, 'emote_talk'),
					level.player,	[~Right, I'll watch my back.~],
									animation('emote_caneshake'),
					self,			[~Best of luck, my boy.\nMilgram won't know what hit him!~],
									set(level.player.animation, 'emote_raisedfinger'),
					level.player,	[~You bet!~],
									set(level.player.animation, 'emote_confused'),
									[~Say, uh... by the way,\nwhat's going to happen to town, here?~],
									animation('mutter_begin'),
					self,			[~Eh, don't worry about that.~],
									animation('emote_confused'),
									[~With their leader gone, Milgram's goons\nwill probably pack up and leave.~],
									animation('emote_canestomp'),
									[~And good riddance!~],
									set(level.player.animation, 'emote_talk'),
					level.player,	[~Well, I'm off.\nThanks for the advice!~],
									animation('mutter_begin'),
					self,			[~Likewise.  Good luck!~],
									set(get_object(level,'town_elder').animation, 'run_scared'),
									
									set(level.zoom, 1),
									set(level.focus, []),
									set(level.player.vars.triggered_events, level.player.vars.triggered_events + ['town-elder-post-fight-speech'])),
		
									schedule(1,begin_script('elder_disposal'))
		]"
		target="get_object(level,'town_elder')"
		[/modification]

	[/script]

